import React from 'react';
import './AlgorithmSelector.css';

function AlgorithmSelector({ onSelect, onClose }) {
  const algorithms = [
    'selection', 'insertion', 'bubble', 'merge',
    'heap', 'quick', 'tree', 'tim'
  ];

  return (
    <div className="algorithm-selector-overlay">
      <div className="algorithm-selector">
        <h2>정렬 알고리즘 선택</h2>
        <div className="algorithm-list">
          {algorithms.map(algo => (
            <button key={algo} onClick={() => onSelect(algo)}>
              {algo} 정렬
            </button>
          ))}
        </div>
        <button onClick={onClose} className="close-btn">닫기</button>
      </div>
    </div>
  );
}

export default AlgorithmSelector;
